
(defn common-subs [dnas]
  (let [smallest-dna (first (sort-by count dnas))
        motifs (apply concat (for [i (range 2 (inc (count smallest-dna)))] (map (partial apply str) (partition i 1 smallest-dna))))
        common-motif? (fn [motif] (every? #(re-find (re-pattern motif) %) dnas))
        common-motifs (filter #(common-motif? %) motifs)]
    (last (sort-by count common-motifs))))

